bioghist.p:
Er waren 3 soorten inspecteurs: 


inspecteurs der Registratie en Domeinen belast met het toezicht op de ontvangers der Registratie en Domeinen;

inspecteurs der Domeinen belast met het beheer der Domeinen;

inspecteurs der Registratie belast met de administratie der registratie in de voormalige ressorten van opgeheven ontvangerskantoren.

processinfo.p:
De bewerkte archieven beslaan de periode 1935-1969. De archieven werden gevormd onder verantwoordelijkheid van de Inspecteurs der Domeinen en door haar registratuur verzorgd. De begindatum is gebaseerd op een verandering van de organisatie, het jaar waarin de inspectie gevormd werd uit kantoren van de Directies der Registratie en Domeinen. Dit vond plaats in de periode 1930-1946. Als einddatum is het jaar genomen waarin de 17 inspecties door reorganisatie tot 6 inspecties werden gereduceerd. Bij de bewerking van de archieven is voor alle 17 inspecties hetzelfde archiefschema aangehouden. Dit schema is terug te vinden in de inhoudsopgave. De leggers zijn als volgt gerangschikt: 


leggers van het domein van Defensie;

leggers der wegen;

leggers der vaarten, veren en havens;

leggers der corporele goederen;

leggers der incorporele goederen;

leggers der vicariën, beneficiën en praebenden;

leggers der onbeheerde nalatenschappen;

leggers der lasten.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
